                <div className="logo">Logo</div>
                <h1 className="title">Título</h1>
                <form className="search-form">
                    <input type="text" placeholder="Buscar..."/>
                    <button type="submit">Ir</button>
                </form>
            </div>
            <div className='Body'>
                <div className='Config'>

                </div>
                <div className='Content'>

                </div>
            </div>
        </div>
    );
}

export default Home;
